import { SET_USER_STATE, USER_LOGGED_OUT, SET_USER_PROJECT } from 'redux/actionsTypes';

const setUserState = (user) => ({
    type: SET_USER_STATE,
    payload: {
        user
    }
})

const userLoggedOut = () => ({
    type: USER_LOGGED_OUT
})

const setUserProject = (project) => ({
    type: SET_USER_PROJECT,
    payload: {
        project
    }
})

const authActions = {
    setUserState,
    userLoggedOut,
    setUserProject
}

export default authActions;
